import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
const Life = () =>  (
        <Row> 
             <Col>
                <div id="my-life">
                    <div className="life-paragraph">
                        <h3>Hello This is my life</h3>
                    </div>
        
                </div>
            </Col>
        </Row>

);

export default Life;
